import React, { useState } from "react";

import AddUser from "./components/AddUser";

function App() {
  function addUserHandler() {
    alert("Add User clicked");
  }
  return (
    <div>
      <AddUser onAddUser={addUserHandler} />
    </div>
  );
}

export default App;
